            value={lobbyName}
            onChange={(e) => updateLobbyName(e.target.value)}
          />
          <Link to={"/lobby-" + lobbyName}>
            <input type="submit" value="Create Lobby" />
          </Link>
        </label>
      </form>
    </div>
  );
}

export default CreateLobby;

